(784, 5, 'Barang bagus banget!', 'Barang bagus banget! Tolong lah jahitanya di rapikan \nJahitan pinggirnya belepasan semua \nMana banyak belebih jahitan pinggirnya\nGak rapi lagi. murah tapi seharusnya tidak seperti barang murahan \n jangan seperti itulah \nSaya mau pesan lagi jadi ragu enth2 yang datang nanti jahitan makin lebih parah', 'Rovy Sanjani', '5', 'Barang bagus banget Tolong lah jahitanya di rapikan Jahitan pinggirnya belepasan semua Mana banyak belebih jahitan pinggirnya Gak rapi lagi murah tapi seharusnya tidak seperti barang murahan jangan seperti itulah Saya mau pesan lagi jadi ragu enth yang datang nanti jahitan makin lebih parah', 'barang bagus banget tolong lah jahitanya di rapikan jahitan pinggirnya belepasan semua mana banyak belebih jahitan pinggirnya gak rapi lagi murah tapi seharusnya tidak seperti barang murahan jangan seperti itulah saya mau pesan lagi jadi ragu enth2 yang datang nanti jahitan makin lebih parah', 'barang bagus banget tolong lah jahitanya di rapikan jahitan pinggirnya belepasan semua mana banyak belebih jahitan pinggirnya tidak rapi lagi murah tapi seharusnya tidak seperti barang murahan jangan seperti itulah saya mau pesan lagi jadi ragu enth2 yang datang nanti jahitan makin lebih parah', '[\"barang\",\"bagus\",\"banget\",\"tolong\",\"lah\",\"jahitanya\",\"di\",\"rapikan\",\"jahitan\",\"pinggirnya\",\"belepasan\",\"semua\",\"mana\",\"banyak\",\"belebih\",\"jahitan\",\"pinggirnya\",\"tidak\",\"rapi\",\"lagi\",\"murah\",\"tapi\",\"seharusnya\",\"tidak\",\"seperti\",\"barang\",\"murahan\",\"jangan\",\"seperti\",\"itulah\",\"saya\",\"mau\",\"pesan\",\"lagi\",\"jadi\",\"ragu\",\"enth2\",\"yang\",\"datang\",\"nanti\",\"jahitan\",\"makin\",\"lebih\",\"parah\"]', 'barang bagus banget tolong lah jahitanya di rapikan jahitan pinggirnya belepasan semua mana banyak belebih jahitan pinggirnya tidak rapi lagi murah tapi seharusnya tidak seperti barang murahan jangan seperti itulah saya mau pesan lagi jadi ragu enth2 yang datang nanti jah